import { ListItemButton, ListItemIcon, ListItemText } from "@mui/material";
import {  AppbarContainer, AppbarHeader, MyList,hoverTextStyles ,hoverButtonStyles} from "../../styles/appbar";
import SearchIcon from '@mui/icons-material/Search';
import Actions from "./Action";
import { useUIContext } from "../../context/ui";
import { Link } from "react-router-dom";

export default function AppbarDesktop({matches}){

const {setShowSearchBox} = useUIContext();

    return(
        <AppbarContainer>
            <AppbarHeader>My Bags</AppbarHeader>
            <MyList type="row">
               <ListItemButton  component={Link} to="/"  sx={hoverTextStyles}> <ListItemText primary="Home" sx={{m : 0,}}></ListItemText></ListItemButton>
                <ListItemButton  component={Link} to='/about' sx={hoverTextStyles}><ListItemText primary="About" sx={{m : 0,}} /></ListItemButton>
                <ListItemButton  component={Link} to='/products' sx={hoverTextStyles}><ListItemText primary="Products" sx={{m : 0,}}/></ListItemButton>
                <ListItemButton component={Link} to="/contact" component={Link} sx={hoverTextStyles}><ListItemText primary="Contact" sx={{m : 0,}}/></ListItemButton>             
                
                <ListItemButton sx={hoverButtonStyles}>
                    <ListItemIcon onClick={() => setShowSearchBox(true)}>
                        <SearchIcon />
                    </ListItemIcon>
                </ListItemButton>
                <Actions matches={matches}/>
            </MyList>
        </AppbarContainer>
    );
};
